            <p>{this.props.faves.length}</p>
            {/* <p>{this.props.faves}</p> */}
            {/* <div>{this.props.faves.map((value, index) =><li key={index}>{value}</li>)}</div> */}
            {/* <button onClick={this.handleSubmit} type="submit">Remove</button> */}
            {/* <p>{allWords}</p> */}
            {allWords}
            {peace}
            </div>
        );
    }
}

export default Saved;
